import * as React from 'react';

const Table = props => {
    return (
        <table>
            <tr>
                <td>
                    <TableItem />
                </td>
            </tr>
        </table>
    )
}

const TableItem = props => {
    const [motorcyclers, setMotorcyclers] = useState(8);
    const styles = {
        width : '100px',
        height : '100px'
    }
    return (
        <div style={styles} onClick={setMotorcyclers(motorcyclers - 1)}>
            {motorcyclers}
        </div>
    )
}
